import React, { useEffect, useState } from 'react';
import axios from 'axios';
import "./VideoListing.scss";
import VideoPlayer from "../VideoPlayer/VideoPlayer";

function VideoListing({ VideoFn }) {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    axios.get('https://take-home-assessment-423502.uc.r.appspot.com/api/user_is?user_id=john_smith')
      .then(response => setVideos(response.data))
      .catch(error => console.error('Error fetching videos:', error));
  }, []);

  return (
    <section className="videolisting">
      <h4 className="videolisting__title">NEXT VIDEOS</h4>
      {videos.map((video) => (
        <VideoPlayer 
          key={video.id}
          id={video.id}
          title={video.title}
          channel={video.channel}
          image={video.image}
          VideoFn={VideoFn} 
        />
      ))}
    </section>
  );
}

export default VideoListing;
